// https://youtu.be/AXKc4WhgLSA - criar header com typeScript

const Header: React.FC = () => {
  

  return (
<HeaderContainer>
  <ButtonTrird />
  < ButtonLogoAnel />  
   <ButtonContainer>  
    <ButtonTrird />
    <ButtonTrird />
    <ButtonTrird />
    <ButtonTrird />
  </ButtonContainer>  
</HeaderContainer>
  )
}

export default Header
